import React from "react";
import "./App.css";
// import the Container Component from the semantic-ui-react
import { Container } from "semantic-ui-react";
// import the ToDoList component
import ShakeSite from "./shakesite.js";
function App() {
  return (
    <div>
      <Container>
        <ShakeSite />
      </Container>
    </div>
  );
}
export default App;
